import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FiArrowLeft } from 'react-icons/fi';
import { Button } from '../../styles/GlobalStyles';
import { 
  PageContainer,
  PageHeader,
  PageTitle,
  HeaderActions,
  FormCard,
  FormGrid,
  FormGroup,
  Label,
  Input,
  ErrorMessage
} from '../../components/Common/CommonStyles';
import { apiService } from '../../services/apiService';
import TripTemplateManager from '../../components/Forms/TripTemplateManager';
import { DutyTemplate } from '../../types';

interface ServiceScheduleFormData {
  name: string;
  startDate: string;
  endDate: string;
}

const CreateServiceSchedule: React.FC = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState<ServiceScheduleFormData>({
    name: '',
    startDate: '',
    endDate: ''
  });
  const [errors, setErrors] = useState<Partial<ServiceScheduleFormData>>({});
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));

    // Clear error when user starts typing
    if (errors[name as keyof ServiceScheduleFormData]) {
      setErrors(prev => ({ ...prev, [name]: undefined }));
    }
  };

  const validateForm = (): boolean => {
    const newErrors: Partial<ServiceScheduleFormData> = {};

    if (!formData.name.trim()) {
      newErrors.name = 'Schedule name is required';
    }

    if (!formData.startDate) {
      newErrors.startDate = 'Start date is required';
    }

    if (!formData.endDate) {
      newErrors.endDate = 'End date is required';
    }

    // Validate date range
    if (formData.startDate && formData.endDate) {
      const startDate = new Date(formData.startDate);
      const endDate = new Date(formData.endDate);

      if (startDate >= endDate) {
        newErrors.endDate = 'End date must be after start date';
      }
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!validateForm()) {
      return;
    }

    setIsSubmitting(true);

    try {
      const scheduleData = {
        name: formData.name,
        startDate: new Date(formData.startDate).toISOString(),
        endDate: new Date(formData.endDate).toISOString()
      };

      await apiService.createServiceSchedule(scheduleData);
      navigate('/service-schedules');
    } catch (error) {
      console.error('Error creating service schedule:', error);
      alert('Failed to create service schedule. Please try again.');
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleCancel = () => {
    navigate('/service-schedules');
  };

  return (
    <PageContainer className="fade-in">
      <PageHeader>
        <PageTitle>Create Service Schedule</PageTitle>
        <HeaderActions>
          <Button variant="secondary" onClick={handleCancel}>
            <FiArrowLeft style={{ marginRight: '8px' }} />
            Back to List
          </Button>
          <Button variant="primary" onClick={handleSubmit} disabled={isSubmitting}>
            {isSubmitting ? 'Creating...' : 'Create Schedule'}
          </Button>
        </HeaderActions>
      </PageHeader>

      <FormCard>
        <form onSubmit={handleSubmit}>
          <FormGrid>
            <FormGroup>
              <Label htmlFor="name">Schedule Name *</Label>
              <Input
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleInputChange}
                placeholder="Enter schedule name"
                hasError={!!errors.name}
              />
              {errors.name && <ErrorMessage>{errors.name}</ErrorMessage>}
            </FormGroup>

            <FormGroup style={{ gridColumn: '1 / -1' }}>
              <Label>Note: The schedule duration is calculated automatically based on the start and end dates.</Label>
            </FormGroup>

            <FormGroup>
              <Label htmlFor="startDate">Start Date *</Label>
              <Input
                type="datetime-local"
                id="startDate"
                name="startDate"
                value={formData.startDate}
                onChange={handleInputChange}
                hasError={!!errors.startDate}
              />
              {errors.startDate && <ErrorMessage>{errors.startDate}</ErrorMessage>}
            </FormGroup>

            <FormGroup>
              <Label htmlFor="endDate">End Date *</Label>
              <Input
                type="datetime-local"
                id="endDate"
                name="endDate"
                value={formData.endDate}
                onChange={handleInputChange}
                hasError={!!errors.endDate}
              />
              {errors.endDate && <ErrorMessage>{errors.endDate}</ErrorMessage>}
            </FormGroup>
          </FormGrid>
        </form>
      </FormCard>
    </PageContainer>
  );
};

export default CreateServiceSchedule;
